/*
 * Your Stylesheet
 *
 * This stylesheet is loaded when Atom starts up and is reloaded automatically
 * when it is changed.
 *
 * If you are unfamiliar with LESS, you can read more about it here:
 * http://www.lesscss.org
 */
.editor {
  -webkit-font-smoothing: antialiased;
}
.editor .cursor-line.line {
  background: transparent !important;
}
.editor .wrap-guide {
  background-color: rgba(255, 255, 255, 0.025);
}
.editor .strikethrough.strike {
  text-decoration: line-through;
}
.editor .strikethrough.marker {
  text-decoration: none !important;
}
.editor .gfm .heading-1,
.editor .gfm .heading-1 .italic,
.editor .gfm .heading-1 .bold,
.editor .gfm .heading-2,
.editor .gfm .heading-2 .italic,
.editor .gfm .heading-2 .bold {
  color: #d08770;
}
.editor .line > .source.gfm > .variable.ordered.list.gfm ~ .line {
  margin-left: 1em !important;
}
.editor .gfm .heading-3,
.editor .gfm .heading-3 .italic,
.editor .gfm .heading-3 .bold,
.editor .gfm .heading-4,
.editor .gfm .heading-4 .italic,
.editor .gfm .heading-4 .bold,
.editor .gfm .heading-5,
.editor .gfm .heading-5 .italic,
.editor .gfm .heading-5 .bold,
.editor .gfm .heading-6,
.editor .gfm .heading-6 .italic,
.editor .gfm .heading-6 .bold {
  color: #b48ead;
}
.editor .gfm .code,
.editor .gfm .raw,
.editor .gfm .quote {
  color: rgba(255, 255, 255, 0.5) !important;
}
.editor .gfm .link,
.editor .gfm .list,
.editor .gfm .mention,
.editor .gfm .issue.tag {
  color: rgba(255, 255, 255, 0.2);
}
.editor .gfm .link .entity,
.editor .gfm .italic,
.editor .gfm .bold {
  color: #ffffff;
}
.markdown-preview {
  -webkit-font-smoothing: subpixel-antialiased;
  font-size: 16px;
  padding: 10%;
}
.markdown-preview h1,
.markdown-preview h2,
.markdown-preview h3,
.markdown-preview h4,
.markdown-preview h5,
.markdown-preview h6 {
  font-size: inherit;
}
.markdown-preview h1 {
  font-size: 1.8em;
  line-height: 1.2em;
  margin-bottom: 2em;
  padding: 0;
}
.markdown-preview h2 {
  font-size: 1.4em;
  line-height: 1.2em;
  margin: 2em 0 1em 0;
  padding: 0;
  padding-bottom: 0.5em;
}
.markdown-preview h3 {
  padding: 0;
  font-size: 1.1em;
  line-height: 1.3em;
}
